import React, { useState } from 'react';
import axios from 'axios';

const Signup = () => {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [phone, setPhone] = useState('');
  const [address, setAddress] = useState('');
  const [companyName, setCompanyName] = useState('');
  const [businessLicense, setBusinessLicense] = useState('');
  const [companyRegNo, setCompanyRegNo] = useState('');
  const [companyEmail, setCompanyEmail] = useState('');
  const [companyPhone, setCompanyPhone] = useState('');
  const [companyAddress, setCompanyAddress] = useState('');
  const [message, setMessage] = useState('');

  const handleSignup = async (e) => {
    e.preventDefault();

    try {
      const res = await axios.post('http://localhost:5000/api/auth/signup', {
        firstName,
        lastName,
        email,
        password,
        phone,
        address,
        companyName,
        businessLicense,
        companyRegNo,
        companyEmail,
        companyPhone,
        companyAddress
      });

      setMessage(res.data.message || 'Signup successful! Awaiting admin approval.');

      // Clear form
      setFirstName('');
      setLastName('');
      setEmail('');
      setPassword('');
      setPhone('');
      setAddress('');
      setCompanyName('');
      setBusinessLicense('');
      setCompanyRegNo('');
      setCompanyEmail('');
      setCompanyPhone('');
      setCompanyAddress('');
    } catch (error) {
      console.error('Signup error:', error);
      setMessage(error.response?.data?.message || 'Signup failed.');
    }
  };

  return (
    <div style={{ textAlign: 'center', marginTop: '50px' }}>
      <h2>External Company Signup</h2>
      <form onSubmit={handleSignup} style={{ display: 'inline-block', textAlign: 'left' }}>
        <input type="text" placeholder="First Name" value={firstName} onChange={(e) => setFirstName(e.target.value)} required /><br />
        <input type="text" placeholder="Last Name" value={lastName} onChange={(e) => setLastName(e.target.value)} required /><br />
        <input type="email" placeholder="Email" value={email} onChange={(e) => setEmail(e.target.value)} required /><br />
        <input type="password" placeholder="Password" value={password} onChange={(e) => setPassword(e.target.value)} required /><br />
        <input type="text" placeholder="Phone" value={phone} onChange={(e) => setPhone(e.target.value)} /><br />
        <input type="text" placeholder="Address" value={address} onChange={(e) => setAddress(e.target.value)} /><br />
        <input type="text" placeholder="Company Name" value={companyName} onChange={(e) => setCompanyName(e.target.value)} /><br />
        <input type="text" placeholder="Business License" value={businessLicense} onChange={(e) => setBusinessLicense(e.target.value)} /><br />
        <input type="text" placeholder="Company Reg. Number" value={companyRegNo} onChange={(e) => setCompanyRegNo(e.target.value)} /><br />
        <input type="email" placeholder="Company Email" value={companyEmail} onChange={(e) => setCompanyEmail(e.target.value)} /><br />
        <input type="text" placeholder="Company Phone" value={companyPhone} onChange={(e) => setCompanyPhone(e.target.value)} /><br />
        <input type="text" placeholder="Company Address" value={companyAddress} onChange={(e) => setCompanyAddress(e.target.value)} /><br />

        <button type="submit" style={{ marginTop: '10px', padding: '8px 16px' }}>Sign Up</button>
      </form>
      {message && <p style={{ color: 'green', marginTop: '10px' }}>{message}</p>}
    </div>
  );
};

export default Signup;
